// These were generated by going into "test_verify_cell_kzg_proof" method in consensus-specs and printing out the
// commitment, cells, proofs and blob that is produced.
//
// For now, we will use this as the source of truth for interoperability.
//
// We have prefixed the publicly facing methods with eth, since the object names are quite
// generic and so that when we move this code, up the stack, we just need to look for the eth namespace.
use bls12_381::{G1Projective, Scalar, G1_POINT_SERIALIZED_SIZE, SCALAR_SERIALIZED_SIZE};

pub fn eth_commitment() -> G1Projective {
    deserialize_compressed_g1(COMMITMENT)
}

pub fn eth_polynomial() -> Vec<Scalar> {
    convert_blob_to_polynomial(BLOB)
}

pub fn eth_cells() -> Vec<Vec<Scalar>> {
    CELLS.into_iter().map(convert_cell_to_scalars).collect()
}

pub fn eth_proofs() -> Vec<G1Projective> {
    PROOFS.into_iter().map(deserialize_compressed_g1).collect()
}

fn convert_blob_to_polynomial(blob: &str) -> Vec<Scalar> {
    let bytes = hex::decode(blob).unwrap();

    assert!(
        bytes.len() % SCALAR_SERIALIZED_SIZE == 0,
        "expected bytes to be a multiple of {SCALAR_SERIALIZED_SIZE}",
    );

    let bytes32s = bytes.chunks_exact(SCALAR_SERIALIZED_SIZE);

    let mut scalars = Vec::with_capacity(bytes32s.len());
    for bytes32 in bytes32s {
        let bytes32 : [u8;SCALAR_SERIALIZED_SIZE]= bytes32.try_into().expect("infallible: expected blob chunks to be exactly {SCALAR_SERIALIZED_SIZE} bytes, since blob was a multiple of {SCALAR_SERIALIZED_SIZE");
        // convert the CtOption into Option
        let option_scalar: Option<Scalar> = Scalar::from_bytes_be(&bytes32).into();
        scalars.push(option_scalar.expect("Result: blob chunk is not a valid scalar"))
    }
    scalars
}

fn convert_cell_to_scalars(cell: &str) -> Vec<Scalar> {
    convert_blob_to_polynomial(cell)
}

fn deserialize_compressed_g1(point: &str) -> G1Projective {
    let point_bytes: [u8; G1_POINT_SERIALIZED_SIZE] = hex::decode(point)
        .expect("point is a malformed hex string")
        .try_into()
        .expect("point should be 48 bytes");
    G1Projective::from_compressed(&point_bytes).expect("cannot deserialize point")
}

